import axios from "axios";

const headers = {
    headers: {
        accept: "appplication/json",
        Authorization:
            "eyJhbGciOiJIUzI1NiJ9.eyJhdWQiOiJlY2NkOTBlY2Y1NTU2ZmQxOTRlN2IxOTc1NDA2MjQ5NSIsIm5iZiI6MTcyMTg4MzA5Ni4xNzA4NzcsInN1YiI6IjY2YTFjYWUzYzhiYmEzMTJlMzcyY2Y5OCIsInNjb3BlcyI6WyJhcGlfcmVhZCJdLCJ2ZXJzaW9uIjoxfQ.fkE0U7_iqbBmAomAP88d8zeaugpk369fcjfFSSGOCFU",
    },
};

// 

export function getMoviesNowPlaying() {
    return (axios.get(
        "https://api.themoviedb.org/3/movie/now_playing?language=en-US&page=1",
        { headers: headers }
    ));
}
